description:
Welcome to the fascinating and colorful world of live wallpapers! In the Live Wallpapers app you will find fantastically bright and incredibly cool live wallpapers for any mood, taste and color! Make your device unique, animate your lock screen and surprise your friends and family!

Dive into unique gallery of more than 1500+ live wallpapers carefully selected and sorted into 27 different categories, such as: Recently Added, Most Popular, Abstract, Animals & Fish, Art, Background, Beach & Water, Birds & Insects, Cities, Fall, Flowers & Plants, Kaleidoscope, Motion, Music, Nature & Landscapes, Particles, People, Science & Technology, Space & Galaxy, Sport, Spring, Starry Sky, Summer, Transport, Winter.

Attention: Live wallpapers only work on the following iPhone models: 6s, 6s Plus, 7, 7 Plus, 8, 8 Plus, X, XS, XS Max. On any other phone models, they can only be used as regular static wallpapers.

How to use the Live Wallpapers app:
- Download your favorite wallpaper to your phone by clicking on the “Save” button;
- Set live wallpaper on the lock screen;
- Press and hold your finger on the lock screen to see the animation;
- Enjoy and share your impressions with friends and family!

What awaits you in the Live Wallpapers app:
- 27 categories of live wallpapers for every mood, taste and color;
- 1500+ live wallpapers with the daily addition of new ones;
- 5 free live wallpapers in each category (135 wallpapers for free);
- convenient wallpaper preview. You can check how the live wallpaper you like on the lock screen will look like or like a regular background on the home screen before downloading them;
- no ads!

Premium Subscription Info:
With a premium subscription, you get full access to all the content and features offered by Live Wallpapers app.
The app contains the following auto-renewable subscription:
- Weekly ($2,99) with a 3-day free trial period
* Subscription price may vary depending on your location.
* Payment will be charged to iTunes Account at confirmation of purchase;
* Subscription automatically renews unless auto-renew is turned off at least 24-hours before the end of the current period;
* Account will be charged for renewal within 24-hours prior to the end of the current period, and identify the cost of the renewal;
* Any unused portion of a free trial period, if offered, will be forfeited when the user purchases a subscription to that publication, where applicable;
* Subscriptions may be managed by the user and auto-renewal may be turned off by going to the user's Account;
* Any unused portion of a free trial period, if offered, will be forfeited when the user purchases a subscription to that publication.

Privacy Policy: https://sites.google.com/view/live-wallpapers-privacy/
Terms of Use: https://sites.google.com/view/live-wallpapers-terms/

Requested access:
Photos - to save live wallpapers you like to your Photos and set them to your Lock Screen.

