Make your device charging unique and incredible with Ampere app. Dive into incredibly cool, unique and colorful charging animations gallery for every taste, color and mood!

 Ampere App Content & Main Features: 
– Gallery of Animations – explore 27 categories of unique Charging Animations, such as: Neon, Technology, etc;
– Preview Animations – see how the selected Animation will look on your device charging before setting it; 
– Edit Animations – customize animations as you want by adding icons and charging sounds, changing colors. It contains 70+ Icons and 70+ Sounds; 
– 1000+ Charging Animations with daily updates;
– No ads!  

These animations are for personal automation using the “Shortcuts” app. Please note that animations will work with the Ampere app installed on your device.

How to Set Charging Animation?
1. Choose Animation you like, then tap “Set” button.
2. Find and open “Shortcuts” app.
3. Tap the Add “+” button in the upper-right corner.
4. Tap or search for “Open App” and tap on it.
5. Tap on “App”.
6. Find and select “Ampere” app.
7. Tap “Done”.
8. Tap on the “Automation” tab and then “New Automation”.
9. Search for or scroll down to find “Charger” then tap on it.
10. Select “Is Connected” then select “Run Immediately” and tap “Next”.
11. Search and tap the “Open App” shortcut that you added earlier in steps 3-7.
12. Done! Your automation for the charging animation has been successfully added.
13. Connect charger, unlock device (if locked) and enjoy your new Charging Animation.

Unclear? Do not worry! You can find a more detailed guide with pictures inside the app by clicking on the “Guide” button.

* Note that free version of the app is limited to 27 Charging Animations only (1 Charging Animation in each category for free). If you want to use the app without limits an auto-renewable subscription ”Ampere Premium (Pro)” is available.

 Auto-renewable Subscription ”Ampere Premium (Pro)” Info:
By subscribing you get premium (full, unlimited) access to all the features and content offered by Ampere app.

Auto-renewable Subscription “Ampere Premium (Pro)” Includes:
– Unlock All Charging Animations;
– Get Daily New Animations;
– Edit Animations;

The app contains the following auto-renewable subscription called ”Ampere Premium (Pro)”:
– Weekly (3,99 US$) with a 3-days for free period.
* Subscription price may vary depending on your location;
* Payment will be charged to iTunes Account at confirmation of purchase;
* Subscription automatically renews unless auto-renew is turned off at least 24-hours before the end of the current period;
* Account will be charged for renewal within 24-hours prior to the end of the current period, and identify the cost of the renewal;
* Subscriptions may be managed by the user and auto-renewal may be turned off by going to the user's Account;
* Any unused portion of a free trial period, if offered, will be forfeited when the user purchases a subscription to that publication, where applicable.

